import React from 'react';

import '../styles/app.css';
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button"
import SearchIcon from '@mui/icons-material/Search';

export default function Header() {
  return (<div className="header">
      <div className="headerLogo flexCenter">GatorStore</div>
      <div className="searchBarContainer flexCenter">
        <TextField id="outlined-basic" label="Search Products" size="medium"/>
        <Button startIcon={<SearchIcon style={{ color: "black" }}/>}/>
      </div>
      <div className="accountButton flexCenter">Seller</div>
  </div>);
}
